import React, {Component} from 'react'
import Layout from "./hoc/Layout/Layout";
import {Route, Switch } from 'react-router-dom'

class App extends Component {
    render() {
        return (
            <Layout>
                <Switch>
                    <Route></Route>
                </Switch>
            </Layout>
        )
    }
}

export default App;
